import React from 'react';
import './App.css';

import { Button, Form, FormGroup, Label, Input }
 from 'reactstrap';

import { FacebookLoginButton } from 'react-socia-login-buttons;'

function App() {
  return (
    <Form className="App">
      <h1><span className="font-weight-bold">website</span>.com</h1>
      <FormGroup>
          <Label>Email</Label>
          <Input type="email" placeholder="Email"/>
      </FormGroup>
    </Form>
  );
}

export default App;
